import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/authContext.jsx';
import Login from './components/login.jsx';
import Register from './components/signup.jsx';
import ForgotPassword from './components/forgotPassword.jsx';
import UserList from './components/userList.jsx';
import ValidateUser from './components/ValidateUser.jsx'; // Importez le composant ValidateUser avec une majuscule
import Home from './components/home.jsx'; // Importez le composant Home

function App() {
  return (
    <div className='app'>
      <AuthProvider>
        <Router>
          <Routes>
            <Route path='/' element={<Login />} />
            <Route path='/signup' element={<Register />} />
            <Route path='/forgot-password' element={<ForgotPassword />} />
            <Route path='/users' element={<UserList />} />
            <Route path="/validate-user/:userId" element={<ValidateUser />} />
            <Route path='/home' element={<Home />} /> {/* Ajoutez la route pour le composant Home */}
          </Routes>
        </Router>
      </AuthProvider>
    </div>
  );
}

export default App;
